import React, { Component } from 'react';
import SignIn from './SignIn';

class LogIn extends Component {
    constructor(props) {
        super(props)
        this.state = {
            typeOf: "SignIn",
        }
    }

    render() {
        return (
            <SignIn />
        );
    }
}

export default LogIn;
